import React,  {Component} from "react";

export default class BookCard extends Component {
    constructor(props){
        super(props);
        this.state = {
            books: props,    
        }
    }
    render() {
        return(
            <div className="card">
                <img src="{books.image}"/>
                <h4>{books.title}</h4>
                <h5>{books.author}</h5>
            </div>
        );
    }
}
